//component in react is just a js function that just returns jsx
//no puedes tener mas de un root element en un componente
import './ExpenseItem.css';

function ExpenseItem(props) { //props es por defecto lo que recibe, no se pasam parms por separad, keyvaluepairs
  const month = props.date.toLocaleString('es-ES', {month:'long'});
  return (
    <div className="expense-item">
      <div>
        <div>
          <div>Month</div>
          <div>Year</div>
          <div>Day</div>
        </div>
      </div>
      <div className="expense-item__description">
        <h2>{props.title}</h2>
        <div className="expense-item__price">${props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
